Remember when I mentioned looking for six brand ambassadors? The list has been published. Well, now it’s time to pick them, and over the next few weeks we will narrow it down. And guess what, we’re doing it on YouTube! We’re going through everyone’s Instagram and having chats to figure out who’s the best fit. We will also discuss what you need to work on if you’re not selected. 

Why do we need ambassadors? Honestly, we don’t really need them, but to get to the top, we all need to step up our game.

Being a Brand Ambassador for Reek Shot It & Team has some cool perks. You’ll get to do two photoshoots a month with three edited pictures for each shoot, all for free (up to three different looks each time). Plus, if someone books a shoot because you referred them, you’ll get 20% of the booking.

Make sure to follow us on social media:
